import React from "react";
import { Container, Wrapper } from "./CrudStyle";

const CrudHooks = () => {
  return (
    <Wrapper>
      <Container>
        <table>
          <thead>
            <tr>
              <td>Id</td>
              <td>Name</td>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>

            </tr>
          </tbody>
        </table>
      </Container>
    </Wrapper>
  );
};

export default CrudHooks;
